import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";

// Reusable Card Component
interface CardProps {
  title: string;
  description: string;
  stars?: string;
}
const Card: React.FC<CardProps> = ({ title, description, stars }) => {
  return (
    <div style={{
      backgroundColor: "#fff",
      padding: "20px",
      borderRadius: "10px",
      boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
      textAlign: "center"
    }}>
      <h3 style={{ fontSize: "1.25rem", fontWeight: 600 }}>{title}</h3>
      <p style={{ marginTop: "8px", color: "#555" }}>{description}</p>
      {stars && <div style={{ marginTop: "8px", fontSize: "1.25rem", color: "#f39c12" }}>{stars}</div>}
    </div>
  );
};

// Navbar Component
const Navbar: React.FC = () => {
  return (
    <nav style={{
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "15px 30px",
      backgroundColor: "#222",
      color: "#fff"
    }}>
      <h2>StoreRatings</h2>
      <div style={{ display: "flex", gap: "20px" }}>
        <span style={{ cursor: "pointer" }}>Home</span>
        <span style={{ cursor: "pointer" }}>Stores</span>
        <span style={{ cursor: "pointer" }}>About</span>
        <span style={{ cursor: "pointer" }}>Contact</span>
      </div>
    </nav>
  );
};

// Hero Section
const Hero: React.FC = () => {
  return (
    <div style={{
      textAlign: "center",
      padding: "60px 20px",
      backgroundColor: "#fff",
      margin: "20px",
      borderRadius: "12px",
      boxShadow: "0 2px 8px rgba(0,0,0,0.1)"
    }}>
      <h1 style={{ fontSize: "2.5rem", fontWeight: 700 }}>Discover Best Stores</h1>
      <p style={{ marginTop: "16px", fontSize: "1.1rem" }}>Rate & review local stores easily.</p>
      <button style={{
        marginTop: "20px",
        padding: "12px 24px",
        backgroundColor: "#f39c12",
        color: "#fff",
        border: "none",
        borderRadius: "6px",
        fontWeight: 500,
        cursor: "pointer"
      }}>
        Explore Stores
      </button>
    </div>
  );
};

// Card Carousel (Swiper)
const CardCarousel: React.FC = () => {
  const slides = [
    { title: "Starbucks", description: "Top rated store" },
    { title: "Café Coffee Day", description: "Best coffee" },
    { title: "Burger King", description: "Delicious meals" }
  ];

  return (
    <div style={{ margin: "20px" }}>
      <Swiper spaceBetween={20} slidesPerView={1} breakpoints={{ 640: { slidesPerView: 2 }, 1024: { slidesPerView: 3 } }}>
        {slides.map((slide, idx) => (
          <SwiperSlide key={idx}>
            <Card title={slide.title} description={slide.description} />
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  );
};

// Footer
const Footer: React.FC = () => {
  return (
    <footer style={{ backgroundColor: "#222", color: "#fff", textAlign: "center", padding: "20px", marginTop: "40px" }}>
      © 2025 StoreRatings. All rights reserved.
    </footer>
  );
};

// Home Page combining all components
const HomePage: React.FC = () => {
  const storeList = [
    { name: "Techies", location: "Pune", stars: "⭐⭐⭐⭐☆" },
    { name: "Book Nook", location: "Mumbai", stars: "⭐⭐⭐☆☆" },
    { name: "Coffee Hub", location: "Kolhapur", stars: "⭐⭐⭐⭐⭐" }
  ];

  return (
    <div style={{ minHeight: "100vh", backgroundColor: "#f4f4f4", fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif" }}>
      <Navbar />
      <Hero />
      <CardCarousel />
      <div style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(240px, 1fr))",
        gap: "20px",
        padding: "20px"
      }}>
        {storeList.map((store, idx) => (
          <Card key={idx} title={store.name} description={store.location} stars={store.stars} />
        ))}
      </div>
      <Footer />
    </div>
  );
};

export default HomePage;
